sys_variable_value.value:
(function execute(inputs, outputs) {
    var extctErrcd = inputs.parseResponse.responseCode;
var message =  inputs.parseResponse.responseRemarks;
  
    
    if(extctErrcd == "E00")
    {
       var status = "200";
     
    }
    else{
       outputs.code=500;
        var status = "failure";
        outputs.message=message;
    }

outputs.status=status;
return outputs;

})(inputs, outputs);

